import React from 'react';
import { Link } from 'react-router-dom';
import Button from '@material-ui/core/Button';
// import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Fade from '@mui/material/Fade';
import PopupState, { bindTrigger, bindMenu } from 'material-ui-popup-state';
import 'antd/dist/antd.css';
import { Menu } from 'antd';
import { MailOutlined, AppstoreOutlined, SettingOutlined } from '@ant-design/icons';
const AppBar = () => {
	const [anchorEl, setAnchorEl] = React.useState(null);
	const open = Boolean(anchorEl);
	const handleClick = (event) => {
		setAnchorEl(event.currentTarget);
	};
	const handleClose = () => {
		setAnchorEl(null);
	};

	return (
		<div className="App">
			<section id="header">
				<div class="header container">
					<div class="nav-bar">
						<div class="brand">
							<div id="drawing">
								<div className="circle"></div>
							</div>
							<a href="#hero">
								<h1><span>NEMO</span> NTU539</h1>
							</a>

							{/* <img src="https://i.ibb.co/Vwf0DbB/Logo.jpg" border="0"/> */}
						</div>
						<div class="nav-list">
							<div class="hamburger">
								<div class="bar"></div>
							</div>
							<ul>
								<li>
									<div>
										<Button
											id="fade-button"
											aria-controls="fade-menu"
											aria-haspopup="true"
											aria-expanded={open ? 'true' : undefined}
											onClick={handleClick}
										>
											Dashboard
										</Button>
										<Menu
											id="fade-menu"
											MenuListProps={{
												'aria-labelledby': 'fade-button',
											}}
											anchorEl={anchorEl}
											open={open}
											onClose={handleClose}
											TransitionComponent={Fade}
										>
											<MenuItem onClick={handleClose}>Profile</MenuItem>
											<MenuItem onClick={handleClose}>My account</MenuItem>
											<MenuItem onClick={handleClose}>Logout</MenuItem>
										</Menu>
									</div>
								</li>
								<li>
									<PopupState variant="popover" popupId="demo-popup-menu">
										{(popupState) => (
											<React.Fragment>
												<Button id="fade-button" variant="contained" {...bindTrigger(popupState)}>
													Dashboard
												</Button>
												<Menu {...bindMenu(popupState)}>
													<MenuItem onClick={popupState.close}>Profile</MenuItem>
													<MenuItem onClick={popupState.close}>My account</MenuItem>
													<MenuItem onClick={popupState.close}>Logout</MenuItem>
												</Menu>
											</React.Fragment>
										)}
									</PopupState>
								</li>
								<li><a href="#hero" data-after="Home"><Link to="/main">Home</Link></a></li>
								<li><a href="#services" data-after="Service">Intro</a></li>
								<li><a href="#projects" data-after="Projects">Publication</a></li>
								<li><a href="#about" data-after="About">Member</a></li>
								<li><a href="#contact" data-after="Contact">Contact</a></li>
							</ul>
						</div>
					</div>
				</div>
			</section>
		</div>
	)
}
export default AppBar;
